const InboxZeroGraphic: FC = () => {
  const {resolvedColorMode: theme} = useTheme()
  switch (theme) {
    case 'day':
    case 'light':
      return <InboxZeroLightGraphic />
    case 'night':
    case 'dark':
      return <InboxZeroDarkGraphic />
    default:
      return null
  }
}

const InboxZeroGraphicWrapper: FC = () => (
  <Box sx={{maxWidth: '364px'}}>
    <InboxZeroGraphic />
  </Box>
)

export default InboxZeroGraphicWrapper
